from liblas import file

def getBetween(t,s1,s2):
    p1 = t.find(s1)
    if p1!=-1:
        p1 = p1 + len(s1)
        t1 = t[p1:]
        p2 = t1.find(s2)
        if p1 != -1:
            chunck = t[p1:p1+p2]
            return chunck
    return False



#apt-get -y install liblas-c3
def getEPSG(filename, default=None):
    
    try:
        f_with_liblas = file.File(filename, mode='r')
        header_file = f_with_liblas.header
        srs_file = header_file.srs

        wkt = str(srs_file.wkt)
        crs_name = getBetween(wkt, 'PROJCS["', '"')
        epsg = ""
        if crs_name != False:
            L_crs_name = crs_name.split(" ")
            print("-->",L_crs_name)
            while len(L_crs_name) != 0:
                crs_j = " ".join(L_crs_name)
                if crs_j in crs2epsg:
                    return crs2epsg[crs_j]
                L_crs_name = L_crs_name[:-1]            
        
        L_epsg = [x[:x.find('"')] for x in wkt.split('EPSG","')[1:]]
        if len(L_epsg)>0:
            return L_epsg[-1]
    except Exception as err:
        print("[Warning] getEPSG:",err)
    print("[Warning] getEPSG: getting '"+str(default)+"' by default")
    return default
